import React from "react";
import Header from "../../header/Header";
import Footer from "../../footer/Footer";
import { Calendar as BigCalendar } from "react-big-calendar";

const Calendar = () => {
  return (
    <div>
      <Header />
      <h1>Calendar Page</h1>
      <Footer />
    </div>
  );
};

export default Calendar;
